package ticket.finder.dto;

public class Dual {
	private String dummy;
	private int mOrder;
	private int mNdps;
	private int mDps;
	private int mTkt;
	private int mJoin;
	
	public Dual() {
		// TODO Auto-generated constructor stub
	}

	public String getDummy() {
		return dummy;
	}

	public void setDummy(String dummy) {
		this.dummy = dummy;
	}

	public int getmOrder() {
		return mOrder;
	}

	public void setmOrder(int mOrder) {
		this.mOrder = mOrder;
	}

	public int getmNdps() {
		return mNdps;
	}

	public void setmNdps(int mNdps) {
		this.mNdps = mNdps;
	}

	public int getmDps() {
		return mDps;
	}

	public void setmDps(int mDps) {
		this.mDps = mDps;
	}

	public int getmTkt() {
		return mTkt;
	}

	public void setmTkt(int mTkt) {
		this.mTkt = mTkt;
	}

	public int getmJoin() {
		return mJoin;
	}

	public void setmJoin(int mJoin) {
		this.mJoin = mJoin;
	}
}
